import React from "react";  
import Footermiddle from "./Footermiddle";
import Footerbottom from "./Footerbottom";


const Price = () => {
    return(
        <>
        <div className="price-outer">
            <div className="container">
                <div className="price-inner">
                    .pri
                </div>
            </div>
        </div>
            <Footermiddle/>
            <Footerbottom/>
        </>
    )
}


export default Price;
